import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule} from '@angular/common/http';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { DatePipe} from '@angular/common';

//components
import { JpgFilesComponent } from './Components/jpg-files/jpg-files.component';
import { NoJpgFilesComponent } from './Components/no-jpg-files/no-jpg-files.component';
import { ListBarComponent } from './Components/list-bar/list-bar.component';
import { HomeComponent } from './Components/home/home.component';
import { SomeJpgFilesComponent } from './Components/some-jpg-files/some-jpg-files.component';
import { ImgComponent } from './Components/img/img.component';

//matirial
import { MatSlideToggleModule } from '@angular/material/slide-toggle';
import { MatTreeModule } from '@angular/material/tree';
import { MatIconModule } from '@angular/material/icon';
import { MatButtonModule } from '@angular/material/button';
import { MatSidenavModule } from '@angular/material/sidenav';
import { MatDividerModule } from '@angular/material/divider';
import { HomePageComponent } from './Components/home-page/home-page.component';


@NgModule({
    declarations: [
        AppComponent,
        SomeJpgFilesComponent,
        NoJpgFilesComponent,
        ImgComponent,
       // ListBarComponent,
        JpgFilesComponent,
        HomeComponent,
        HomePageComponent

    ],
    providers: [],
    bootstrap: [AppComponent],
    imports: [
        BrowserModule,
        AppRoutingModule,
        BrowserAnimationsModule,
        HttpClientModule,
        DatePipe,
        //???
        // JpgFilesComponent,
        // ListBarComponent ,
        // HomeComponent,


        //MATRIAL
        MatSlideToggleModule,
        MatTreeModule,
        MatIconModule,
        MatButtonModule,
        MatSidenavModule,
        MatDividerModule
    ]
})
export class AppModule { }
